INSERT INTO `admin` (`id`, `username`, `password`, `remember_token`, `created_at`, `updated_at`, `message`, `rules`, `role`) VALUES
(12, 'lctip2016', '$2y$10$rZ2dlx/HUqc6tSk35L.p1.Hhmu6P0EWUDAvM5FvVjBl2I1GkB.y3G', 'xC7oh90mZiatnwuyRq7wqubnugBmPsTyKnjVqNx0twL3dcLpvGjSzoKlXwFH', NULL, '2016-09-12 19:39:03', '<p>Hasil Online Test LCTIP 24 2016 dapat diakses pukul 15.30&nbsp;</p>', '<h1>PENGUMUMAN</h1>\r\n<ol>\r\n<li>Babak <em>Online Test</em> dilaksanakan pada hari Sabtu-Minggu, tanggal 10-11 September 2016 dengan rincian waktu pelaksanaan :</li>\r\n</ol>\r\n<p><strong>Region I-IV&nbsp;&nbsp;&nbsp;&nbsp; : Sabtu, 10 September 2016</strong></p>\r\n<p><strong>Region V-VIII : Minggu, 11 September 2016</strong></p>\r\n<ol start="2">\r\n<li>Peserta hanya dapat mengakses soal <em>Online Test </em>dengan login terlebih dahulu sesuai akun yang telah didaftarkan dan telah terverifikasi pada subdomain www.online-test.lctip.com</li>\r\n<li>Pengerjaan soal <em>Online Test </em>sesuai dengan jadwal yang telah ditentukan.</li>\r\n<li>Peserta hanya dapat mengerjakan soal <em>Online Test </em>sebanyak satu kali (sekali <em>attempt </em>saja).</li>\r\n<li>Peserta mengerjakan soal secara beregu. Masing-masing anggota tim dapat mengerjakan soal secara bersama melalui perangkat yang berbeda, namun dengan akun tim yang sama.</li>\r\n<li>Soal penyisihan <em>Online Test </em>terdiri atas 100 soal pilihan ganda dengan proporsi 10 soal per halaman, dengan masing-masing 20 soal Matematika, 20 soal Fisika, 20 soal Kimia, 20 soal Biologi, dan 20 soal Pangan.</li>\r\n<li>Pengerjaan soal <em>Online Test </em>berdurasi 120 menit (tanpa tambahan waktu) terhitung setelah peserta mengklik tombol <em>attempt </em>pada akun timnya untuk pertama kalinya dalam kurun waktu <strong>09.00 &ndash; 16.00 WIB</strong> (<strong>Waktu mulai pengerjaan soal</strong>). Di luar kurun waktu tersebut, soal <em>Online Test </em>tidak dapat diakses.</li>\r\n<li>Peserta dapat mengerjakan soal secara acak dengan halaman soal <em>Online Test </em>yang dapat dipindah-pindah. Jawaban peserta otomatis tersimpan meskipun halaman dipindah-pindah.</li>\r\n<li>Peserta dapat mengklik tombol &ldquo;<em>finish</em>&rdquo; jika dirasa sudah selesai menyelesaikan soal <em>Online Test</em> dan jawaban peserta otomatis tersimpan.</li>\r\n<li>Jika waktu pengerjaan soal <em>Online Test </em>sudah habis, jawaban yang telah terjawab secara otomatis tersimpan.</li>\r\n<li>Sistem skor sebagai berikut: bernilai <strong>+4</strong> bila jawaban <strong>benar</strong>, <strong>-1</strong> bila jawaban <strong>salah</strong>, dan <strong>0</strong> bila <strong>mengosongkan jawaban</strong>.</li>\r\n<li>Perihal gangguan koneksi internet di luar tanggung jawab panitia.</li>\r\n<li>Apabila terjadi gangguan koneksi internet, waktu pengerjaan soal <em>Online Test</em> tetap berjalan dan tidak ada penambahan waktu pengerjaan.</li>\r\n<li>Peserta yang sedang ataupun telah mengerjakan soal <em>Online Test </em>dilarang memberitahukan soal kepada peserta lain dan melakukan <em>screensho</em><em>o</em><em>t </em>soal serta menyebarluaskan soal melalui internet.</li>\r\n<li>Peserta yang terbukti melakukan kecurangan saat mengerjakan soal <em>Online Test </em>akan didiskualifikasi oleh panitia.</li>\r\n<li><strong>Seratus (100)</strong> regu dengan nilai tertinggi berhak lolos ke babak Preliminary dengan rincian, yaitu:</li>\r\n</ol>\r\n<p><strong>Empat puluh (40) </strong>regu terbaik pertama lolos dengan nilai tertinggi berdasarkan regional dengan rincian 5 regu terbaik dengan nilai tertinggi pada setiap REGION.</p>\r\n<p><strong>Enam puluh (60) </strong>regu terbaik lainnya lolos dengan nilai tertinggi yang diurutkan secara nasional setelah diambil 40 tim terbaik berdasarkan regional.</p>\r\n<ol start="17">\r\n<li>Jika terjadi kesamaan total skor, maka regu yang lolos adalah regu dengan skor tertinggi pada soal pangan.</li>\r\n<li>Pengumuman seratus (100) regu yang berhak lolos ke babak <em>Preliminary</em> akan diumumkan pada situs web LCTIP XXIV.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'admin'),
