(26, '<p>Jika kedua akar persamaan&nbsp; <img src="/imagesUploaded/11.jpg" alt="" />saling berlawanan tetapi mempunyai nilai mutlak yang sama, maka nilai m adalah&hellip;</p>', '<p>1</p>', '<p><img src="/imagesUploaded/1a.jpg" alt="" /></p>', '<p>c</p>', '<p><img src="/imagesUploaded/1b.jpg" alt="" /></p>', '<p><img src="/imagesUploaded/1d.jpg" alt="" /></p>', 'C', NULL, '2016-08-31 19:30:50', '2016-09-06 22:07:43'),
(27, '<p>Nilai yang memenuhi <img src="/imagesUploaded/2.jpg" alt="" />&nbsp;adalah&hellip;</p>', '<p><img src="/imagesUploaded/2e.jpg" alt="" /></p>', '<p>&nbsp;&nbsp;<img src="/imagesUploaded/2a.jpg" alt="" /></p>', '<p><img src="/imagesUploaded/2b.jpg" alt="" /></p>', '<p><img src="/imagesUploaded/2c.jpg" alt="" /></p>', '<p><img src="/imagesUploaded/2d.jpg" alt="" /></p>', 'A', NULL, '2016-08-31 19:35:44', '2016-09-02 13:36:27'),
(28, '<p>Lingkaran&nbsp;<img src="/imagesUploaded/3.jpg" alt="" />&nbsp;memotong sumbu y di titik P dan Q. Salah satu persamaan garis singgung lingkaran tersebut adalah&hellip;</p>', '<p><img src="/imagesUploaded/Screen_Shot_2016-09-04_at_12.34_.46_AM_.png" alt="" /></p>', '<p><img src="/imagesUploaded/Screen_Shot_2016-09-04_at_12.36_.25_AM_.png" alt="" /></p>', '<p><img src="/imagesUploaded/Screen_Shot_2016-09-04_at_12.36_.11_AM_.png" alt="" /></p>', '<p><img src="/imagesUploaded/Screen_Shot_2016-09-04_at_12.35_.48_AM_.png" alt="" /></p>', '<p><img src="/imagesUploaded/Screen_Shot_2016-09-04_at_12.35_.11_AM_.png" alt="" /></p>', 'C', NULL, '2016-08-31 19:38:20', '2016-09-03 10:36:44'),
(29, '<p>Jika&nbsp;<img src="/imagesUploaded/Screen_Shot_2016-09-01_at_9.40_.22_AM_1.png" alt="" />, maka&nbsp;<img src="/imagesUploaded/Screen_Shot_2016-09-01_at_9.40_.27_AM_1.png" alt="" />&nbsp;adalah...</p>', '<p>2</p>', '<p>-1</p>', '<p>-1/3</p>', '<p>1/3</p>', '<p>1</p>', 'B', NULL, '2016-08-31 22:19:01', '2016-09-03 10:34:17'),
(30, '<p>Di antara 20.000 dan 70.000, banyak bilangan genap dengan tidak ada digit berulang adalah...</p>', '<p>24.998</p>', '<p>3.360</p>', '<p>4.032</p>', '<p>7.392</p>', '<p>10.080</p>', 'C', NULL, '2016-08-31 22:19:52', '2016-09-03 10:33:45'),
(31, '<p>Diberikan balok&nbsp;<em>ABCD.EFGH&nbsp;</em>dengan&nbsp;<em>AB = AE = 4&nbsp;</em>dan&nbsp;<em>BC = 3</em>. Titik&nbsp;<em>P&nbsp;</em>dan&nbsp;<em>Q&nbsp;</em>masing-masing titik tengah&nbsp;<em>FG&nbsp;</em>dan&nbsp;<em>GH</em>. Maka tangen sudut bidang balok&nbsp;diagonal <em>FHBD</em> dan bidang <em>PQBD</em> adalah&hellip;</p>', '<p>7/16</p>', '<p>1/10</p>', '<p>3/10</p>', '<p>2/5</p>', '<p>3/8</p>', 'B', NULL, '2016-08-31 22:22:09', '2016-09-06 22:17:26'),
(32, '<p>Jika suku pertama, ke-3 dan ke-6 suatu barisan aritmetika masing-masing adalah b-a, a, dan 36 serta jumlah 9 suku pertama barisan tersebut adalah 180, maka beda barisan tersebut adalah...</p>', '<p>6</p>', '<p>18</p>', '<p>16</p>', '<p>12</p>', '<p>9</p>', 'B', NULL, '2016-08-31 22:24:51', '2016-09-03 10:32:48'),
(33, '<p>Banyak akar real&nbsp;<img src="/imagesUploaded/Screen_Shot_2016-09-01_at_12.25_.17_PM_.png" alt="" />adalah...</p>', '<p>9</p>', '<p>2</p>', '<p>3</p>', '<p>4</p>', '<p>6</p>', 'B', NULL, '2016-08-31 22:25:56', '2016-09-03 10:15:55'),
(34, '<p>Bila&nbsp;<img src="/imagesUploaded/Screen_Shot_2016-09-01_at_12.26_.31_PM_.png" alt="" />&nbsp;maka&nbsp;<img src="/imagesUploaded/Screen_Shot_2016-09-01_at_12.26_.38_PM_.png" alt="" />&nbsp;= ...</p>', '<p><img src="/imagesUploaded/9e.jpg" alt="" /></p>', '<p><img src="/imagesUploaded/9a.jpg" alt="" /></p>', '<p><img src="/imagesUploaded/9b.jpg" alt="" /></p>', '<p><img src="/imagesUploaded/9c.jpg" alt="" /></p>\r\n<p>&nbsp;</p>', '<p><img src="/imagesUploaded/9d.jpg" alt="" /></p>', 'C', NULL, '2016-08-31 22:28:28', '2016-09-06 22:23:45'),
(35, '<p>Segitiga ABC siku-siku di B. Titik C pada garis lurus BD sehingga CD = 3 dan BC = 2. Jika AB = 1 dan sudut CAD =&nbsp;&beta; maka&nbsp;sin<sup>2</sup>&beta; = ...</p>', '<p>5/201</p>', '<p>25/26</p>', '<p>4/5</p>', '<p>31/175</p>\r\n<p>&nbsp;</p>', '<p>9/130</p>', 'C', NULL, '2016-08-31 22:30:03', '2016-09-03 10:14:58'),
(36, '<p>Diketahui <em>a, b, c, d</em> adalah bilangan-bilangan bulat positif yang memenuhi <em>a &gt; b &gt; c &gt; d</em> dan <em>a+b+c+d = a<sup>2</sup>-b<sup>2</sup>+c<sup>2</sup>-d<sup>2&nbsp;</sup></em>= 2012. Berapakah banyaknya nilai a yang memenuhi kondisi<em>&nbsp;</em>tersebut?</p>', '<p>505</p>', '<p>501</p>', '<p>502</p>', '<p>503</p>', '<p>504</p>', 'A', NULL, '2016-08-31 22:32:12', '2016-09-06 22:29:34'),
(37, '<p>Diketahui bilangan riil positif <em>a </em>dan <em>b </em>memenuhi persamaan <em>a<sup>4</sup> </em> + <em>a<sup>2</sup>b<sup>2 </sup></em>+ <em>b<sup>4</sup> </em>= 6 dan <em>a<sup>2</sup> </em>+ <em>ab </em>+ <em>b<sup>2</sup> </em>= 4.&nbsp;Nilai dari&nbsp;<em>a </em>+ <em>b </em>adalah..</p>', '<p>Tidak ada jawaban yang benar</p>', '<p>1/2 &radic;21</p>', '<p>1/2 &radic;14</p>', '<p>1/2 &radic;8</p>', '<p>1/2 &radic;2</p>', 'A', NULL, '2016-08-31 22:33:06', '2016-09-07 22:23:18'),
(39, '<p>Untuk&nbsp;<img src="/imagesUploaded/Screen_Shot_2016-09-01_at_12.33_.34_PM_.png" alt="" />maka&nbsp;<img src="/imagesUploaded/Screen_Shot_2016-09-01_at_12.34_.31_PM_.png" alt="" />adalah...</p>', '<p><img src="/imagesUploaded/13e.jpg" alt="" /></p>', '<p><img src="/imagesUploaded/13a1.jpg" alt="" /></p>', '<p><img src="/imagesUploaded/13b.jpg" alt="" /></p>', '<p><img src="/imagesUploaded/13c.jpg" alt="" /></p>', '<p><img src="/imagesUploaded/13d.jpg" alt="" /></p>', 'B', NULL, '2016-08-31 22:36:22', '2016-09-06 23:14:57'),
(40, '<p>Besar suku ke-2016 dari barisan 1, 3, 6, 10, ... adalah...</p>', '<p>2033164</p>', '<p>2033136</p>', '<p>2033146</p>', '<p>2033138</p>', '<p>2033148</p>', 'A', NULL, '2016-08-31 22:39:14', '2016-09-03 10:12:45'),
