(79, '<p>Sebuah kompor listrik dengan spesifikasi 300V, 4&Omega; digunakan untuk memasak 5 telur secara bersama dengan masing-masing massa = 70 gram selama 1.5 menit. Diketahui berdasarkan penelitian bahwa satu kilogram telur akan matang jika dikenakan kalor&nbsp;sebesar 11571x10<sup>3</sup> Berapa kalor yang diberikan oleh kompor? Apakah kelima telur tersebut matang?</p>', '<p>33.75 kJ ; setengah matang</p>', '<p>33.75 kJ ; matang</p>', '<p>33.75 kJ ; tidak matang</p>', '<p>2025 kJ ; setengah matang</p>', '<p>2025 kJ ; matang</p>', 'C', NULL, '2016-09-01 08:40:11', '2016-09-06 16:38:11'),
(80, '<p>Untuk mengukur luas permukaan sebuah kristal yang ukurannya telah tereduksi menggunakan persamaan berikut<img src="/imagesUploaded/Screen_Shot_2016-09-01_at_10.40_.12_PM_.png" alt="" /></p>\r\n<p>Keterangan:&nbsp;</p>\r\n<p>&lambda; = faktor bahan</p>\r\n<p>m = massa tembus</p>\r\n<p>D = rerata ukuran saringan</p>\r\n<p>Jika suatu bahan (massa jenis 1000 kg/m<sup>3 </sup>dan faktor bahan 0.3) tembus 48% pada saringan dengan ukuran 2.83 mm tetapi tidak tembus dalam saringan 2.00 mm, luas permukaan jika total bahan yang disaring sebesar 5 kg adalah...</p>\r\n<p>&nbsp;</p>', '<p>Tidak ada jawaban yang benar</p>', '<p>1.7888&nbsp;m<sup>2</sup></p>', '<p>2.0866&nbsp;m<sup>2</sup></p>', '<p>1.9767&nbsp;m<sup>2</sup></p>', '<p>1.5698&nbsp;m<sup>2</sup></p>', 'A', NULL, '2016-09-01 08:41:32', '2016-09-06 16:37:42'),
(81, '<p>Termometer A ketika digunakan untuk mengukur suhu air membeku menunjukkan skala -10<sup>o</sup>A dan ketika digunakan untuk mengukur air mendidih menunjukkan angka 150<sup>o</sup> Ketika termometer A digunakan untuk mengukur kuah bakso bersuhu&nbsp;60<sup>o</sup>C, angka yang ditunjukkan termometer A adalah...</p>', '<p>105<sup>o</sup>A</p>', '<p>75<sup>o</sup>A</p>', '<p>86<sup>o</sup>A</p>', '<p>94<sup>o</sup>A</p>', '<p>98<sup>o</sup>A</p>', 'B', NULL, '2016-09-01 08:42:21', '2016-09-06 16:37:07'),
(82, '<p>Sepotong es bersuhu -10<sup>o</sup>C dan bermassa 500 gram dipanaskan sehingga menjadi air bersuhu 10<sup>o</sup> Banyaknya energi kalor yang diserap es tersebut adalah...</p>\r\n<p>(C<sub>es</sub>=0.5 kal/g<sup>o</sup>C; C<sub>air</sub>=1.0 kal/g<sup>o</sup>C; L<sub>es</sub>=80 kal/g)</p>', '<p>50000 kalori</p>', '<p>40000 kalori</p>', '<p>42500 kalori</p>', '<p>45000 kalori</p>', '<p>47500 kalori</p>', 'D', NULL, '2016-09-01 08:43:16', '2016-09-06 16:36:47'),
