(86, '<p>Sebuah benda dengan luas permukaan 100 cm<sup>2</sup> bersuhu 727<sup>o</sup>C (Koefisien Stefan-Boltzman 5.67 x 10<sup>&minus;8</sup> W/mK<sup>4</sup> dan emisivitas benda adalah 0.6) digunakan untuk meradiasi 2 kg bahan pangan.&nbsp;Jika bakteri <em>Salmonella </em>mati pada selang energi 0.37 &ndash; 0.80 kGy, maka waktu dibutuhkan untuk membasmi <strong>semua</strong> <em>Salmonella</em> adalah...</p>', '<p>Tidak ada hubungan antara radiasi dengan penghancuran bakteri</p>', '<p>10.5 menit</p>', '<p>3 menit</p>', '<p>56 detik</p>', '<p>4.7 detik</p>', 'D', NULL, '2016-09-01 08:46:22', '2016-09-06 23:22:57'),
(87, '<p>Seorang anak berada pada jarak 1 hm dari sebuah sumber penggiling padi yang berdaya 19.76 watt. Tentukan besar taraf intensitas bunyi yang didengar anak tersebut jika &pi; = 3.14 dan intensitas ambang pendengaran I<sub>0</sub> = 10<sup>-12</sup> watt/m<sup>2</sup></p>', '<p>Tidak ada jawaban yang benar</p>', '<p>80.03 dB</p>', '<p>81.96 dB</p>', '<p>82.76 dB</p>', '<p>Bunyi tidak terdengar</p>', 'B', NULL, '2016-09-01 08:47:29', '2016-09-06 16:35:34'),
