(89, '<p>Perhatikan pernyataan berikut!</p>\r\n<ol style="list-style-type: upper-roman;">\r\n<li>Etanol mengandung ikatan O-H non polar sehingga tidak dapat bercampur baik dengan air.</li>\r\n<li>Etanol membentuk ikatan hidrogen dengan air.</li>\r\n<li>Titik didih etanol lebih tinggi dibandingkan hidrokarbon dengan jumlah atom karbon yang sama.</li>\r\n<li>Pada temperatur sama, tekanan uap jenuh etanol lebih rendah dari air.</li>\r\n</ol>\r\n<p>Diantara pernyataan di atas manakah pernyataan yang BENAR mengenai etanol:</p>', '<p>Semua pernyataan benar</p>', '<p>Pernyataan II dan III</p>', '<p>Pernyataan I dan II</p>', '<p>Pernyataan I dan III</p>', '<p>PernyataanI, II, dan IV</p>', 'A', NULL, '2016-09-01 08:49:30', '2016-09-06 16:35:04'),
(90, '<p>Larutan dengan komposisi 5 mol aseton (P<sup>o</sup> = 324 mm Hg) dan 5 mol kloroform (P<sup>o</sup> = 274 mm Hg) mempunyai tekanan uap 236 mm Hg. Berikut ini, manakah pernyataan yang benar mengenai larutan tersebut?</p>', '<p>Dua dari jawaban di atas benar</p>', '<p>Larutan bersifat non ideal dan memiliki volume kontraksi</p>', '<p>Proses pencampuran kedua cairan murni tersebut adalah eksoterm karena gaya antar molekul tidak sejenis lebih lemah dibandingkan dengan molekul sejenis</p>', '<p>Larutan menunjukkan deviasi negatif dari hukum Raoult dan mempunyai <img src="/imagesUploaded/Screen_Shot_2016-09-01_at_10.51_.15_PM_.png" alt="" />H<sub>pencampuran</sub> &gt; 0</p>', '<p>Larutan menunjukkan deviasi negatif dari hukum Raoult dan mempunyai <img src="/imagesUploaded/Screen_Shot_2016-09-01_at_10.51_.15_PM_1.png" alt="" />H<sub>pencampuran</sub> &lt; 0</p>', 'E', NULL, '2016-09-01 08:51:51', '2016-09-03 07:34:42'),
(91, '<p>Dalam kondisi temperatur dan tekanan tertentu, sebanyak 1.85 x 10<sup>-4</sup> mol Xe direaksikan dengan 5 x 10<sup>-4 </sup>mol F<sub>2.&nbsp;</sub>Setelah reaksi, ternyata terbentuk produk XeF<sub>4 </sub>dan XeF<sub>6 </sub>dan sisa gas Xe sebanyak&nbsp;9 x 10<sup>-4&nbsp;</sup>mol. Berdasarkan kondisi ini maka tentukan komposisi % berat produk XeF<sub>4 </sub>dan XeF<sub>6</sub> hasil reaksi tersebut....</p>', '<p>86.10% dan 13.90%</p>', '<p>6.45% dan 93.55%</p>', '<p>13.90% dan 86.10%</p>\r\n<p>&nbsp;</p>', '<p>65% dan 35%</p>', '<p>93.55% dan 6.45%</p>', 'B', NULL, '2016-09-01 08:53:10', '2016-09-06 16:34:25'),
(92, '<p>Unsur dengan konfigurasi elektron 1s<sup>2 </sup>2s<sup>2</sup> 2p<sup>6</sup> 3s<sup>2</sup> 3p<sup>6</sup> 3d<sup>7</sup> 4s<sup>2</sup> memiliki pernyataan sebagai berikut:</p>\r\n<ol style="list-style-type: upper-roman;">\r\n<li>Mempunyai nomor atom 27</li>\r\n<li>Terletak pada periode 4</li>\r\n<li>Mempunyai 3 elektron tak berpasangan</li>\r\n<li>Termasuk ke dalam golongan alkali tanah</li>\r\n</ol>\r\n<p>Pernyataan di atas yang benar mengenai konfigurasi elektron di atas adalah&hellip;</p>', '<p>Semua pernyataan benar</p>', '<p>Pernyataan I, II dan III</p>', '<p>Pernyataan I dan III</p>', '<p>Pernyataan&nbsp;II dan IV</p>', '<p>Pernyataan IV saja</p>', 'A', NULL, '2016-09-01 08:54:03', '2016-09-06 16:33:36'),
