(100, '<p>Ion karbonium merupakan substrat yang kehilangan atom dengan elektronegativitas atom yang hilang ini lebih besar daripada elektrnegativitas atom karbon (C). Manakah yang <strong>TIDAK BENAR</strong> mengenai sifat ion karbonium?</p>', '<p>Melakukan penataan ulang menjadi ion karbonium yang lebih stabil</p>', '<p>Ion karbonium dapat bergabung dengan ion positif</p>', '<p>Dapat menarik ion hidrida dari alkana</p>', '<p>Mengeliminasi ion hidrogen membentuk suatu ikatan rangkap</p>', '<p>Mengalkilasi cincin aromatik</p>', 'A', NULL, '2016-09-01 09:02:11', '2016-09-06 16:30:26'),
