(103, '<p>Padatan garam X<sub>2</sub>SO<sub>4</sub> ditambahkan ke dalam larutan basa lemah XOH, sehingga konsentrasi X<sub>2</sub>SO<sub>4</sub> menjadi 0.05 M dan konsentrasi larutan XOH menjadi 0,1 M. Jika <em>Kb </em>basa XOH = 10<sup>-5</sup>, maka pH larutan penyangga yang terbentuk adalah...</p>', '<p>5</p>', '<p>5 - log 2</p>', '<p>9 + log 2</p>', '<p>9 + 2 log 2</p>', '<p>9</p>', 'B', NULL, '2016-09-01 09:05:10', '2016-09-06 16:29:25'),
(104, '<p>Larutan glukosa dalam air mendidih pada 100.26&deg; Jika Kb = 0.52 dan Kf = 1.86, maka larutan tersebut akan membeku pada suhu ... &deg;C.</p>', '<p>-1.86</p>', '<p>1.86</p>', '<p>0.93</p>', '<p>0</p>', '<p>-0.93</p>', 'D', NULL, '2016-09-01 09:05:47', '2016-09-03 07:43:40'),
(105, '<p>Dari reaksi N<sub>2</sub>O<sub>4</sub> (g) &harr; 2NO<sub>2</sub>, diketahui <em>Kp </em>pada 600&deg;C dan pada 1000&deg;C berturut-turut adalah 1.8 x 10<sup>4</sup> dan 2.8 x 10<sup>4</sup>. Pernyataan untuk reaksi di atas adalah sebagai berikut:</p>\r\n<ol style="list-style-type: upper-roman;">\r\n<li>Tekanan parsial NO<sub>2</sub> akan meningkat jika suhu sistem dinaikkan</li>\r\n<li>&Delta;H &gt; 0</li>\r\n<li>Peningkatan tekanan total campuran gas dalam kesetimbangan akan menurunkan kadar NO<sub>2</sub></li>\r\n<li>Kp = Kc</li>\r\n</ol>\r\n<p>Pernyataan di atas yang benar adalah&hellip;</p>', '<p>Semua pernyataan benar</p>', '<p>Pernyataan I, II, dan III</p>', '<p>Pernyataan I dan III</p>', '<p>Pernyataan II dan IV</p>', '<p>Pernyataan IV saja</p>', 'A', NULL, '2016-09-01 09:06:56', '2016-09-06 16:28:59'),
(106, '<p>Tetapan disosiasi asam cuka adalah 10<sup>-7</sup>. Jika suatu larutan asam cuka ini memiliki pH bernilai 4, manakah di bawah ini yang merupakan konsentrasi dari asam cuka tersebut?</p>', '<p>10<sup>-7</sup></p>', '<p>10<sup>-1</sup></p>', '<p>10<sup>-3</sup></p>', '<p>10<sup>-4</sup></p>', '<p>10<sup>-5</sup></p>', 'A', NULL, '2016-09-01 09:07:32', '2016-09-03 07:44:59'),
(107, '<p>Polimer yang dibentuk oleh kondensasi glukosa disebut polisakarida. Berikut disediakan beberapa senyawa:</p>\r\n<ol style="list-style-type: upper-roman;">\r\n<li>Asam amino</li>\r\n<li>Kanji</li>\r\n<li>DNA</li>\r\n<li>Pektin</li>\r\n</ol>\r\n<p>Dari senyawa-senyawa&nbsp;di atas, yang merupakan polisakarida ditunjukkan dalam pernyataan..</p>', '<p>Semua pernyataan benar</p>', '<p>Pernyataan I, II, dan III</p>', '<p>Pernyataan I dan III</p>', '<p>Pernyataan II dan IV</p>', '<p>Pernyataan IV saja</p>', 'C', NULL, '2016-09-01 09:08:14', '2016-09-06 16:27:56'),
(108, '<p>Dalam senyawa atau ion yang mengandung sulfur berikut ini, muatan formal atom S dalam SO<sub>2</sub>, SO<sub>3</sub>, SO<sub>3</sub><sup>2-</sup>, SO<sub>4</sub><sup>2-</sup> secara berturut-turut adalah...</p>', '<p>+1, 0, 0, -2</p>', '<p>0, 0, 0, 0</p>', '<p>-2, 0, 0, +1</p>', '<p>0, +1, -2, 4</p>', '<p>0, 0, +1, -2</p>', 'A', NULL, '2016-09-01 09:09:03', '2016-09-03 07:45:46'),
(109, '<p>Daging sapi atau kornet dapat dikalengkan agar memperpanjang umur simpan. Proses tersebut dapat menghambat pertumbuhan mikroorganisme patogen melalui mekanisme anaerob, akan tetapi ada mikroorganisme yang sering ditemukan pada makanan kaleng tersebut ditemukan pada makanan kaleng tersebut dan saat diteliti pH dari makanan tersebut adalah 4.7. Mikroorganisme yang mungkin tumbuh adalah...</p>', '<p><em>Salmonella thypi</em></p>', '<p><em>Clostridium botulinum</em></p>', '<p><em>Aspergillus niger</em></p>', '<p><em>Aerobacter aerogenes</em></p>', '<p><em>Bacteroides fragilis</em></p>', 'A', NULL, '2016-09-01 09:09:45', '2016-09-06 16:27:17'),
(110, '<p>Fibrosis sistek merupakan kelainan genetik letal yang paling umum terjadi di Amerika Serikat. Pernyataan berikut yang <strong>TIDAK BENAR</strong> mengenai kelainan tersebut adalah...</p>', '<p>Alel normal gen ini mengkode suatu protein membrane yang berfungsi untuk transpor klorida</p>', '<p>Saluran transpor klorida cacat atau tidak ada</p>', '<p>Mukus pelindung sel-sel tertentu menjadi lebih cair</p>', '<p>Melumpuhkan antibiotik alamiah di dalam tubuh</p>', '<p>Penyerapan nutrisi dari usus sangat buruk</p>', 'B', NULL, '2016-09-01 09:10:43', '2016-09-03 07:20:53'),
(111, '<p>Sel punca merupakan sel yang belum mengalami spesialisasi dan dapat mereproduksi diri secara tidak terbatas dan dapat menempuh jalur-jalur diferensiasi yang spesifik. Sel punca dapat diisolasi pada saat pembentukan zigot, manakah di bawah ini yang merupakan tahap saat sel punca dapat diisolasi?</p>', '<p>Organogenesis</p>', '<p>Morula</p>', '<p>Gastrula</p>', '<p>Blastula</p>', '<p>Embrio awal</p>', 'C', NULL, '2016-09-01 09:11:10', '2016-09-06 16:26:23'),
(112, '<p>Seorang ibu mendapati anaknya mengendarai mobil secara ugal-ugalan. Sang ibu mengingatkan anaknya untuk memegang hidung dan menutup matanya. Setelah ditelusuri, anak tersebut mengkonsumsi alkohol dalam jumlah yang cukup banyak. Tes tersebut berguna untuk mengetahui efek alkohol pada bagian otak...</p>', '<p>Serebelum</p>', '<p>Mesenfalon</p>', '<p>Serebrum</p>', '<p>Mielensefalon</p>', '<p>Diensefalon</p>', 'E', NULL, '2016-09-01 09:11:44', '2016-09-06 16:26:01'),
(113, '<p>Hipotesis paling masuk akal untuk menjelaskan mengapa kekayaan spesies di wilayah tropis lebih tinggi daripada wilayah beriklim sedang adalah bahwa...</p>', '<p>Wilayah tropis memiliki laju imigrasi yang sangat tinggi dan laju kepunahan yang sangat rendah</p>', '<p>Komunitas tropis lebih muda</p>', '<p>Keanekaragaman hayati meningkat sewaktu evapotranspirasi menurun</p>', '<p>Wilayah tropis umumnya memiliki air yang lebih mudah diperoleh dan radiasi surya yang banyak</p>', '<p>Suhu tinggi mempercepat spesiasi</p>', 'C', NULL, '2016-09-01 09:12:40', '2016-09-03 07:22:15'),
(114, '<p>Apakah ancaman paling besar terhadap biodiversitas?</p>', '<p>Pengubahan, fragmentasi, dan penghancuran habitat</p>', '<p>Eksploitasi berlebihan dari spesies-spesies yang penting secara komersial</p>', '<p>Spesies hasil introduksi yang bersaing dengan atau memangsa spesies asli</p>', '<p>Pencemaran udara, air, dan tanah di bumi</p>', '<p>Pemutusan hubungan trofik seiring meningkatnya spesies mangsa yang punah</p>', 'E', NULL, '2016-09-01 09:13:38', '2016-09-03 07:22:52'),
(115, '<p>Beberapa jenis hiu menutup matanya tepat sebelum menggigit. Walaupun tidak dapat melihat mangsanya, hiu mampu menggigit secara tepat. Para peneliti mengamati bahwa hiu seringkali salah menggigit objek logam dan dapat menemukan baterai yang terkubur&nbsp;di bawah pasir akuarium. Bukti menunjukkan bahwa hiu menentukan letak mangsanya beberapa saat sebelum ia menggigit. Peristiwa ini mirip dengan..</p>', '<p>Cacing pipih menghindari tempat yang terang</p>', '<p>Ular beludak menemukan mencit dalam liang</p>', '<p>Ngengat ular sutra jantan menemukan pasangan kawin</p>', '<p>Kelelawar menemukan ngengat dalam gelap</p>', '<p>Platipus menemukan letak mangsanya dalam sungai berlumpur</p>', 'D', NULL, '2016-09-01 09:14:15', '2016-09-06 16:25:19'),
(116, '<p>Hasil pengamatan manakah yang menyebabkan Sutherland menyimpulkan adanya keterlibatan pembawa pesan kedua dalam efek epinefrin terhadap sel hati...</p>', '<p>Epinefrin diketahui memiliki efek yang berbeda pada jenis sel yang berbeda</p>', '<p>Aktivitas enzimatik sebanding dengan jumlah kalsium yang ditambahkan ke ekstrak bebas sel</p>', '<p>Penelitian terhadap reseptor mengindikasikan bahwa epinefrin adalah ligan</p>', '<p>Penguraian glikogen terjadi hanya jika epinefrin diberikan ke sel utuh</p>', '<p>Penguraian glikogen terjadi ketika epinefrin dan glikogen fosforilase digabungkan</p>', 'C', NULL, '2016-09-01 09:14:53', '2016-09-03 07:24:45'),
(117, '<p>Pangan dapat rusak akibat mikroba, di antara mikroba tersebut dapat menimbulkan penyakit pada manusia (<em>Foodborne disease</em>) yang disebut mikroba patogen. Pada bahan pangan yang disimpan pada suhu rendah akan timbul beberapa mikroba patogen,&nbsp;<strong>kecuali</strong>...</p>', '<p><em>Campylobacter jejuni</em></p>', '<p><em>Aeromonas hydrophyla</em></p>', '<p><em>Clostridium botulinum </em>tipe E</p>', '<p><em>Yersinia enterolitica</em></p>', '<p><em>Listeria monocytogenes</em></p>', 'E', NULL, '2016-09-01 09:15:45', '2016-09-06 16:24:39'),
(118, '<p>Pada tumbuhan yang melakukan fotosintesis terdapat beberapa protein yang dapat membantu dalam proses tersebut, salah satu protein pendukung dalam reaksi fotosintesis adalah protein reseptor yang berfungsi dalam menangkap sinyal dan memberikan respon.&nbsp;Kemampuan dari satu peristiwa pengikatan ligan tunggal untuk memicu banyak jalur merupakan ciri reseptor...</p>', '<p>Tidak ada jawaban yang benar</p>', '<p><em>Ligan-gated ion channel</em></p>', '<p><em>Receptor tyrosine kinase</em></p>', '<p><em>G-Protein-coupled reseptor</em></p>', '<p><em>Local regulator</em></p>', 'B', NULL, '2016-09-01 09:16:31', '2016-09-06 16:24:10'),
(119, '<p>Kembar identik merupakan kembar yang berasal dari satu sel telur yang dibuahi oleh satu sperma. Akibat hal tertentu, maka hasil pembelahan dari zigot kemudian akan memisah dan membentuk embrio sendiri-sendiri. Apabila pemisahan terjadi saat blastokista, maka pernyataan yang tepat adalah...</p>', '<p>C dan D benar</p>', '<p>Masing-masing bayi akan memiliki plasenta dan kantung amnion sendiri</p>', '<p>Bayi akan memiliki plasenta yang sama, namun tiap bayi akan memiliki amnion sendiri</p>', '<p>Kedua bayi akan memiliki plasenta dan amnion yang sama</p>', '<p>Masing-masing bayi akan memiliki umbilikalnya sendiri, tetapi berada pada kantung amnion yang sama</p>', 'E', NULL, '2016-09-02 13:40:19', '2016-09-06 16:23:44'),
(120, '<p>Bakteri penyebab tetanus hanya dapat dibunuh dengan pemanasan yang lama di atas titik didih. Hal ini mengindikasikan bahwa bakteri tetanus...</p>', '<p>Menghasilkan endospora</p>', '<p>Memiliki dinding sel yang mengandung peptidoglikan</p>', '<p>Melindungi diri sendiri dengan mensekresikan antibiotik</p>', '<p>Menseksresikan endotoksin</p>', '<p>Autotrof</p>', 'A', NULL, '2016-09-02 13:41:54', '2016-09-02 13:41:54'),
(121, '<p>Proses transpor elektron berbalik (<em>reverse</em>) pada mikroba fotosintetik dan mikroba kemolitotrofik digunakan pada kondisi berikut&hellip;</p>', '<p>A dan B benar</p>', '<p>Kondisi anaerob</p>', '<p>Kekurangan energi cahaya</p>', '<p>Level ATP seluler yang tinggi</p>', '<p>Level yang rendah dari pembawa elekron (contoh: NADH, NADPH, FADH<sub>2</sub>)</p>', 'D', NULL, '2016-09-02 13:43:23', '2016-09-02 13:43:23'),
(122, '<p>Mikroorganisme baru tumbuh pada minuman ringan (<em>diet coke</em>) yang menggunakan pemanis buatan, yaitu aspartam, dalam keadaan tanpa oksigen melalui fermentasi dan menghasilkan asam butirat. Dari pengamatan tersebut, manakah pernyataan berikut yang&nbsp;<strong>BENAR&nbsp;</strong>mengenai metabolisme aspartam?</p>', '<p>Semua jawaban di atas salah</p>', '<p>Merupakan sumber yang rendah energi</p>', '<p>Aspartam dapat diproses menjadi senyawa antara (intermediet) kaya energi</p>', '<p>Penggunaannya bergantung pada rantai transpor elektron</p>', '<p>Merupakan suatu prekursor asam amino</p>', 'B', NULL, '2016-09-02 13:45:22', '2016-09-06 16:23:01'),
(123, '<p>Keberadaan celah pada insang embrio kelinci mengindikasikan bahwa..</p>', '<p>Teori regenerasi mungkin benar</p>', '<p>Kelinci bernapas dengan insang pada tahap gastrula</p>', '<p>Kelinci adalah turunan dari amfibi</p>', '<p>Vertebrata memiliki nenek moyang yang sama</p>', '<p>Sifat-sifat yang diperoleh dapat diturunkan</p>', 'C', NULL, '2016-09-02 13:51:03', '2016-09-02 13:51:03'),
(124, '<p>Pembasmi serangga merupakan racun jenis organofosfat. Racun ini dapat menghambat kerja dari enzim asetilkolinesterase yaitu enzim yang memecah neurotransmitter asetilkolin. Salah satu sinaps yang menggunakan neurotransmiter asetilkolin adalah sinaps&nbsp;yang menggunakan neurotransmiter asetilkolin adalah sinaps yang menghubungkan neuron motorik dengan otot rangka. Apakah yang terjadi pada seseorang yang mengkonsumsi baygon?</p>', '<p>Otot tetap berkontraksi secara normal</p>', '<p>Kejang otot akibat membran sel otot terdepolarisasi secara terus menerus</p>', '<p>Kejang otot akibat membran sel otot mengalami hiperpolarisasi secara terus menerus</p>', '<p>Otot mengalami paralisis karena sel otot tidak mendapat rangsangan dari sel saraf</p>', '<p>Otot mengalami atropi karena tidak mendapat rangsang dari sel saraf</p>', 'A', NULL, '2016-09-02 13:52:38', '2016-09-06 16:22:26'),
(125, '<p>Louis Pasteur merupakan orang yang pertama kali melakukan pengamatan mengenai sistem kekebalan adaptif. Ia mengamati bahwa pemerah susu yang memerah susu dari sapi yang terkena <em>cow pox </em>akan terhindar dari penyakit sejenis yang mematikan yaitu&nbsp;<em>small fox</em>. Setelah dilakukan pengamatan, dua penyakit tersebut disebabkan oleh dua organisme yang berbeda. Di masa sekarang, diketahui bahwa sesuatu yang menyebabkan kekebalan pada pemerah susu tersebut adalah antibodi. Berdasarkan keterangan di atas, pernyataan berikut yang benar adalah...</p>', '<p>A dan B benar</p>', '<p>Dua organisme yang menyebabkan <em>small pox </em>dan <em>cow pox </em>memiliki antigen yang sama</p>', '<p>Dua organisme yang menyebabkan <em>small pox </em>dan <em>cow pox </em>memiliki epitop yang sama</p>', '<p>Dua organisme tersebut adalah bakteri</p>', '<p>Antibodi yang menyerang <em>small pox </em>dan <em>cow pox </em>diproduksi oleh dua klon sel B yang berbeda</p>', 'E', NULL, '2016-09-02 13:54:59', '2016-09-06 16:21:51'),
(126, '<p>Unsur atau nutrien yang berperan penting dalam pengikatan cincin porfirin pada klorofil a adalah..</p>', '<p>Magnesium (Mg)</p>', '<p>Besi (Fe)</p>', '<p>Tembaga (Cu)</p>', '<p>Kalium (K)</p>', '<p>Seng (Zn)</p>', 'C', NULL, '2016-09-02 13:56:53', '2016-09-02 13:56:53'),
(127, '<p>Suatu kultur mikroba difraksinasi menjadi beberapa komponen. Salah satu komponen mengandung molekul berikut ini yaitu asam asetilmuramat, asetilglukosamin, berbagai L dan D asam amino, dan amino teichoat maupun asam lipoteichoat. Dari pernyataan di atas, apakah komponen tersebut?</p>', '<p>Dinding sel suatu ragi</p>', '<p>Dinding sel suatu bakteri gram positif</p>', '<p>Glikogen</p>', '<p>Dinding sel suatu bakteri gram negatif</p>', '<p>Membran sitoplasma</p>', 'A', NULL, '2016-09-02 13:58:39', '2016-09-06 16:20:51'),
(128, '<p>Selama tahap infeksi lanjut, <em>Listeria monocytogenes </em>memiliki resistensi yang tinggi terhadap perlakuan dengan antibiotik gentamisin, sedangkan pada tahap infeksi awal, mikroba tersebut cukup rentan. Pernyataan manakah yang paling tepat menggambarkan mekanisme kolonisasi sesuai pengamatan?</p>', '<p>Tidak ada jawaban yang benar</p>', '<p>Flagela pada <em>Listeria monocytogenes </em>membantu dalam asosiasi dengan jaringan lain</p>', '<p><em>Listeria monocytogenes </em>bermutasi dengan sempurna sehingga resisten</p>', '<p>Sekali inang terinfeksi, bakteri tersebut kehilangan kerentanannya pada semua antibiotik</p>', '<p>Gentamisin tidak termasuk ke dalam sel-sel eukariotik</p>', 'D', NULL, '2016-09-02 14:00:45', '2016-09-06 16:20:14'),
(129, '<p>Air bersifat berbeda dengan air murni dan lebih sukar dihilangkan dibandingkan air bebas. Molekul-molekul air membentuk ikatan hidrogen dengan molekul air lain dan terdapat pada mikrokapiler. Air ini berada dalam bahan pangan beras. Air tersebut termasuk ke dalam tipe air...</p>', '<p>Bukan merupakan tipe air</p>', '<p>Tipe 1</p>', '<p>Tipe 2</p>', '<p>Tipe 3</p>', '<p>Tipe 4</p>', 'B', NULL, '2016-09-02 14:02:16', '2016-09-06 16:19:54'),
(130, '<p>Iradiasi produk pangan memerlukan energi radiasi dengan penetrasi yang baik untuk menginaktivasi mikroba dan enzim. Salah satu tipe energi radiasi yang digunakan memiliki keunggulan antara lain:</p>\r\n<ol style="list-style-type: upper-roman;">\r\n<li>Menghambat proses penghambatan buah</li>\r\n<li>Membunuh serangga pada berbagai stadium</li>\r\n<li>Mengatasi kehilangan produk pertanian pada pasca panen</li>\r\n<li>Memproses produk pada skala komersial</li>\r\n<li>Merupakan daya penetrasi yang sangat kuat pada produk</li>\r\n</ol>\r\n<p>Dari keunggulan di atas, tipe energi radiasi tersebut adalah&hellip;</p>', '<p>Sinar&nbsp;Beta</p>', '<p>Sinar Neutron</p>', '<p>Sinar X</p>', '<p>Sinar Alfa</p>', '<p>Sinar&nbsp;Gamma</p>', 'D', NULL, '2016-09-02 14:04:48', '2016-09-06 16:19:27'),
(131, '<p>Alat yang digunakan untuk melakukan <em>mixing </em>terbagi menjadi beberapa tipe yaitu <em>horizontal screw and ribbon mixer</em>, <em>vertical screw mixer</em>, serta <em>tumbling mixer</em>. Perbedaan <em>vertical mixer </em>dengan <em>tumbling mixer&nbsp;</em>yaitu...</p>', '<p><em>Tumbling mixer </em>memiliki ulir dengan posisi miring dan bergerak mengelilingi tabung</p>', '<p><em>Vertical mixer </em>memiliki ulir dengan posisi miring dan bergerak mengelilingi tabung</p>', '<p><em>Tumbling mixer </em>memiliki ulir dengan posisi yang lebih kompleks dan bergerak mengelilingi tabung</p>', '<p><em>Vertical mixer </em>memiliki ulir dengan posisi yang lebih sederhana dan bergerak searah tabung</p>', '<p><em>Tumbling mixer </em>memiliki ulir dengan posisi yang lebih sederhana dan bergerak mengelilingi tabung</p>', 'E', NULL, '2016-09-02 14:05:56', '2016-09-06 16:18:08'),
(132, '<p>Kristalisasi merupakan proses pembentukan bahan padat dari pengendapan larutan, <em>melt </em>(campuran leleh), atau lebih jarang pengendapan langsung dari gas. Pengendalian kristalisasi dapat dilakukan melalui beberapa hal, salah satunya merupakan&nbsp;pencegahan pengembangan yaitu ditandai dengan...</p>', '<p>Adanya bercak-bercak putih kehitaman di atas lapisan coklat akibat karamelisasi</p>', '<p>Adanya keputih-putihan pada lapisan bersamaan dengan warna coklat</p>', '<p>Adanya keputih-putihan pada permukaan lapisan bersamaan dengan warna hitam kecoklatan</p>', '<p>Adanya bercak-bercak putih pada lapisan atas warna coklat</p>', '<p>Adanya bercak-bercak putih pada permukaan lapisan atas warna hitam kecoklatan</p>', 'C', NULL, '2016-09-02 14:07:29', '2016-09-06 16:17:45'),
(133, '<p>Perhatikan gambar di bawah ini!</p>\r\n<p><img src="/imagesUploaded/gambar_851.jpg" alt="" width="351" height="84" /></p>\r\n<p>Gambar tersebut memiliki nama IUPAC...</p>', '<p>Trans-Linolenic acid</p>', '<p>&alpha;-Linolenic acid</p>', '<p>&beta;-Linolenic acid</p>', '<p>&gamma;-Linolenic acid</p>', '<p>Cis-Linolenic acid</p>', 'C', NULL, '2016-09-02 14:10:41', '2016-09-06 16:17:17'),
(134, '<p><em>Chilling injury </em>merupakan kerusakan fisiologis yang disebabkan penyimpanan pada suhu dingin tetapi masih berada di atas suhu beku. Peristiwa tersebut dapat diamati secara visual pada daging dan permukaan produk seperti proses pencoklatan,&nbsp;kerusakan pada kulit maupun pembusukan yang berlebihan. Mekanisme terjadinya <em>chilling injury </em>akan mengalami tahapan berikut, <strong>kecuali</strong>...</p>', '<p>Penimbunan zat atau metabolit beracun seperti asetaldehida, etanol dalam jumlah besar dapat merusak sel</p>', '<p>Peningkatan energi aktivasi bagi enzim-enzim yang berasosiasi dengan membran saat permeabilitas meningkat</p>', '<p>Setelah terjadinya kondisi rigid pada membran lipid, laju aliran protoplasmik akan berhenti</p>', '<p>Permeabilitas yang meningkat akan menyebabkan kebocoran zat terlarut yang berupa garam dan keseimbangan ion dapat terganggu</p>', '<p>Ketidakseimbangan metabolisme dan meningkatnya ketersediaan ATP secara berlebihan akan terjadi akibat energi aktivasi yang meningkat bagi enzim-enzim yang berasosiasi dengan membran</p>', 'D', NULL, '2016-09-02 14:11:59', '2016-09-06 16:16:53'),
(135, '<p>Kekakuan tubuh pada ikan setelah terjadinya kematian yang disebabkan kekurangan jumlah ATP yang tersedia sehingga kontraksi otot akan terjadi secara terus menerus dan tidak dapat relaksasi merupakan peristiwa <em>rigor mortis</em>. Faktor yang&nbsp;mempengaruhi laju rigor mortis antara lain jenis ikan, ukuran ikan, kondisi ikan, metode pembunuhan ikan, <em>struggle prior to death </em>dari ikan, dan suhu. Manakah di bawah ini merupakan pernyataan yang <strong>BENAR</strong> mengenai keadaan ikan dalam mengalami rigor mortis sesuai dengan faktornya?</p>', '<p>Suhu : ikan yang berada pada kondisi dingin akan lebih awal mengalami <em>rigor mortis</em></p>', '<p>Jenis ikan : ikan demersal akan mengalami <em>rigor</em> lebih lama dibandingkan ikan pelagik</p>', '<p>Ukuran ikan : ikan berukuran kecil akan mengalami <em>rigor mortis</em> lebih lambat dibandingkan dengan ikan berukuran besar</p>', '<p>Kondisi ikan : ikan yang stres akan mengalami <em>rigor mortis</em> lebih lama</p>', '<p><em>Struggle prior to death </em>: ikan yang berjuang lebih banyak sebelum mati akan mengalami <em>rigor mortis</em> lebih awal</p>', 'D', NULL, '2016-09-02 14:14:10', '2016-09-06 16:16:11'),
(136, '<p>Perhatikan gambar bagian telur di bawah ini!</p>\r\n<p><img src="/imagesUploaded/telur.jpg" alt="" width="220" height="257" /></p>\r\n<p>Telur merupakan produk pangan berbentuk bulat atau oval yang dikeluarkan oleh induk betina yang dikelilingi oleh suatu&nbsp;membran yang melindungi embrio di dalamnya. Salah satu membran yang berfungsi melindungi embrio pada telur adalah <em>chalazae</em>, berikut adalah penjelasan mengenai <em>chalazae</em> yang<strong> TIDAK BENAR</strong>, kecuali&hellip;</p>', '<p>Dapat menentukan kesegaran telur jika <em>chalazae</em> memiliki ikatan yang lebih kuat dan dapat membentuk busa sehingga memberikan manfaat tambahan bagi telur untuk penyajian <em>sponge cake</em></p>', '<p>Bagian ini merupakan bagian luar transparan yang melapisi <em>yolk </em>pada telur</p>', '<p>Berbentuk seperti tali yang menjaga agar <em>yolk </em>pada telur tetap terletak di bagian tengah telur</p>', '<p>Mengandung hampir 57% protein telur dan terdiri dari beberapa protein seperti ovalbumin, canalbumin, ovotransferin, lisozim</p>', '<p>Terdiri dari <em>inner membrane </em>dan <em>outer shell membrane </em>yang berfungsi untuk melindungi ovari pada telur</p>', 'B', NULL, '2016-09-02 14:16:53', '2016-09-06 16:15:43'),
(137, '<p><em>Modified cassava flour </em>atau biasa disebut MOCAF merupakan tepung berbasis singkong yang dihasilkan dari irisan singkong yang difermentasi oleh bakteri asam laktat dengan kultur yang ditambahkan. Apa saja enzim yang dihasilkan oleh mikroba pada MOCAF?</p>', '<p>Enzim papain dan enzim amylase</p>', '<p>Enzim lipase dan enzim papain</p>', '<p>Enzim laktase dan enzim isomerase</p>', '<p>Enzim sellulolitik dan enzim papain</p>', '<p>Enzim sellulolitik dan enzim pektinolitik</p>', 'D', NULL, '2016-09-02 14:18:06', '2016-09-06 16:14:58'),
(138, '<p>Proses pembuatan biji kopi dapat dilakukan secara proses kering maupun proses basah. Pada proses basah, diperlukan proses fermentasi selama 72 jam dengan bantuan enzim pektinase. Lendir yang menempel pada bagian luar biji kopi akan dihilangkan karena&nbsp;mengandung senyawa gula yang menyerap air dan media yang tepat untuk pertumbuhan bakteri sehingga dapat merusak mutu biji kopi. Khamir yang membantu mengubah senyawa gula tersebut menjadi alkohol adalah...</p>', '<p><em>Saccharomyces cariocanus</em></p>', '<p><em>Saccharomyces cariocus</em></p>', '<p><em>Saccharomyces bulderi</em></p>', '<p><em>Saccharomyces paradoxus</em></p>', '<p><em>Saccharomyces cerevisiae</em></p>', 'D', NULL, '2016-09-02 14:19:09', '2016-09-06 16:14:19');
INSERT INTO `quiz` (`id`, `question`, `choices5`, `choices1`, `choices2`, `choices3`, `choices4`, `answer`, `remember_token`, `created_at`, `updated_at`) VALUES
(139, '<p>Pembekuan pada makanan tidak dapat memperbaiki mutu pangan, melainkan hanya mengawetkan mutu asli dari bahan pangan. Menurut estimasi waktu, pembekuan dibagi menjadi pembekuan cepat yang memakan waktu kurang dari 30 menit dan pembekuan lambat yang&nbsp;memakan waktu 30 hingga 72 jam. Salah satu kelebihan dari pembekuan cepat dibandingkan pembekuan lambat adalah...</p>', '<p>Pencegahan mutu mikroba berlangsung lebih cepat karena estimasi waktu lebih cepat</p>', '<p>Kerusakan mekanis lebih cepat terjadi akibat estimasi waktu yang terlalu cepat</p>', '<p>Kristal es yang terbentuk berukuran besar karena tidak adanya pemerataan bentuk saat proses pembekuan</p>', '<p>Kegiatan enzim yang terjadi pada bahan pangan meningkat</p>', '<p>Mutu yang dihasilkan pada bahan pangan tidak selalu lebih baik tergantung dengan kesesuaian pembekuan</p>', 'E', NULL, '2016-09-02 14:20:19', '2016-09-06 16:13:37'),
(140, '<p>Pewarna makanan adalah bahan tambahan pangan berupa pewarna alami dan sintetik, yang ketika ditambahkan pada pangan mampu memberi atau memperbaiki warna. Jenis pewarna sintetik yang diizinkan antara lain adalah...</p>', '<p>Tartrazin, antosianin, indigotin, klorofil</p>', '<p>Tartrazin, merah allura, hijau FCF, karmoisin</p>', '<p>Tartrazin, antosianin, biru berlian, merah allura</p>', '<p>Ponceau 4R, eritrosin, ekstrak annato, indigotin</p>', '<p>Coklat HT, merah allura, hijau FCF, kurkumin</p>', 'A', NULL, '2016-09-02 14:21:25', '2016-09-06 16:13:04'),
(141, '<p>Perhatikan gambar di bawah ini!</p>\r\n<p><img src="/imagesUploaded/93.jpg" alt="" width="336" height="195" /></p>\r\n<p>Berbagai pilar dalam pedoman gizi seimbang memiliki fungsi tertentu, yaitu...</p>', '<p>Pilar 1 sebagai pedoman aktivitas fisik dan Pilar 2 digunakan untk mencuci tangan</p>', '<p>Pilar 1 sebagai penyeimbang makanan dan Pilar 2 digunakan untuk aktivitas fisik</p>', '<p>Pilar 1 sebagai penyeimbang makanan dan Pilar 2 digunakan untuk mencuci tangan</p>', '<p>Pilar 1 sebagai penyeimbang makanan dan Pilar 2 digunakan untuk memantau berat badan</p>', '<p>Pilar 1 sebagai pedoman aktivitas fisik dan Pilar 2 digunakan untuk memantau berat badan</p>', 'B', NULL, '2016-09-02 14:23:49', '2016-09-06 16:12:45'),
(142, '<p>Produksi biskuit dimulai dengan pengepresan dan pengaturan ketebalan biskuit, lalu dilanjutkan dengan proses relaksasi dan pemotongan biskuit menjadi bentuk yang diinginkan. Setelah dipotong, maka bentuk biskuit telah rapih dan siap untuk dilakukan&nbsp;proses selanjutnya. Relaksasi pada pembuatan proses biskuit dimaksudkan untuk&hellip;</p>', '<p>Penjagaan ketebalannya agar konstan sehingga tidak kerut saat proses pemotongan</p>', '<p>Pengistirahatan adonan setelah dilakukan pengepresan untuk kemudian dilakukan proses pemotongan</p>', '<p>Penambahan sifat elastis pada adonan sehingga terbentuk tekstur biskuit yang diinginkan saat pemotongan</p>', '<p>Penjagaan sifat elastisitas biskuit agar mudah dilakukan pembentukan dan pemotongan</p>', '<p>Penghilangan sifat elastisitas agar mudah dilakukan pemotongan dan pengepresan</p>', 'E', NULL, '2016-09-02 14:25:01', '2016-09-06 16:12:19'),
(143, '<p>Codex ialah lembaga antar-pemerintahan di bawah <em>United Nations </em>(FAO/WHO) yang terdiri dari 185 anggota negara dan 1 anggota organisasi (EU). Codex berfungsi dalam mengadopsi standar berbasis sains dalam perlindungan kesehatan konsumen dan praktek perdagangan pangan yang adil. Codex mengatur klaim kandungan gizi secara absolut, menurut pedoman umum Codex klaim <em>sugar free </em>(bebas gula) pada produk pangan memiliki batas toleransi sebesar...</p>', '<p>Tidak ada jawaban yang benar</p>', '<p>&le; 0.5 gram per 100 gram produk padat</p>', '<p>&le; 0.75 gram per 100 gram produk padat</p>', '<p>&ge; 0.5 gram per 100 ml produk cair</p>', '<p>&ge; 0.75 gram per 100 ml produk cair</p>', 'A', NULL, '2016-09-02 14:26:31', '2016-09-06 16:11:44'),
(144, '<p>Persamaan Michaelis-Menten merupakan salah satu metode analisis kuantitatif kinetika reaksi pada enzim. Persamaan ini menyatakan hubungan kuantitatif kecepatan reaksi awal (V<sub>o</sub>), kecepatan reaksi maksimum (V<sub>maks</sub>), konsentrasi&nbsp;substrat ([S]), dan konstanta Michaelis-Menten (Km). Persamaan ini menyatakan bahwa kurva kecepatan reaksi dan konsentrasi substrat akan berbentuk hiperbolik apabila...</p>', '<p>Semua pernyataan di atas salah</p>', '<p>Semakin tinggi konsentrasi substrat, kecepatan reaksi semakin lambat sehingga akhirnya konsentrasi substrat ikut menurun</p>', '<p>Semakin tinggi konsenrasi substrat, kecepatan reaksi semakin lambat dan akhirnya tidak dipengaruhi lagi oleh konsentrasi</p>', '<p>Semakin rendah konsentrasi substrat, kecepatan reaksi akan semakin lambat</p>', '<p>Semakin rendah konsentrasi substrat, kecepatan reaksi semakin lambat dan akhirnya tidak dipengaruhi lagi oleh konsentrasi</p>', 'B', NULL, '2016-09-02 14:27:40', '2016-09-06 16:10:52'),
(145, '<p><em>Intermediate Moisture Food </em>(IMF) merupakan bahan pangan yang mempunyai kandungan air 15-50% dan Aw sekitar 0.6-0.85 serta stabil pada suhu kamar dan bersifat plastis dan tidak kering. Jika diketahui suatu produk memiliki kondisi optimum sebagai berikut:</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Pektin&nbsp; : 0.75 &ndash; 1.5%</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Gula&nbsp;&nbsp;&nbsp; : 65 &ndash; 70%</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; pH&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : pH 3.2 &ndash; 3.4</p>\r\n<p>Kondisi optimum di atas merupakan pembentukan yang terjadi pada&hellip;</p>', '<p><em>Jam</em></p>', '<p>Gel dari jeli</p>', '<p><em>Jam, </em>jeli, dan <em>marmalade</em></p>', '<p>Gel pada <em>marmalade</em></p>', '<p>Jeli dan <em>marmalade</em></p>', 'A', NULL, '2016-09-02 14:30:36', '2016-09-06 16:10:09'),
(146, '<p>Menurut UU No. 18/2012 tentang Pangan, ketahanan pangan didefinisikan sebagai kondisi tepenuhinya pangan bagi negara sampai dengan perseorangan, yang tercermin dari tersedianya pangan yang cukup, baik jumlah ataupun mutunya, aman, beragam, bergizi,&nbsp;merata, dan terjangkau. Komponen utama ketahanan pangan menurut organisasi kesehatan dunia adalah...</p>', '<p>Ketersediaan pangan, akses pangan, pemanfaatan pangan</p>', '<p>Ketersediaan pangan, akses pangan, sumber daya pangan</p>', '<p>Akses pangan, sumber daya pangan, kemampuan fungsional pangan</p>', '<p>Sumber daya pangan, pemanfaatan pangan, kemampuan fungsional pangan</p>', '<p>Pemanfaatan pangan, akses pangan, sumber daya pangan</p>', 'E', NULL, '2016-09-02 14:31:50', '2016-09-06 16:09:08'),
(147, '<p>Glutamat adalah salah satu dari 20 asam amino penyusun protein. Sebagai asam amino, glutamat termasuk dalam kelompok non essensial, yang artinya tubuh mampu memproduksi sendiri. Asam amino L-glutamate atau garamnya dapat digunakan sebagai pembangkit citarasa, yaitu...</p>', '<p>A, B, dan C salah</p>', '<p>Monosodium Glutamat</p>', '<p>Inosin 5&rsquo;-monofosfat</p>', '<p>Guanin Monofosfat</p>', '<p>A, B, dan C benar</p>', 'D', NULL, '2016-09-02 14:33:11', '2016-09-06 16:08:32'),
(148, '<p>Air merupakan komponen yang penting dalam sistem pangan. Salah satunya yaitu dalam stabilitas pangan yang dapat mempengaruhi aktivitas kimia dan mikrobiologis dengan cara&hellip;</p>', '<p>Semua Benar</p>', '<p>Mobilisasi padatan amorf</p>', '<p>Akumulasi berlebih</p>', '<p>Sebagai pelarut</p>', '<p>A dan C benar</p>', 'E', NULL, '2016-09-02 14:34:16', '2016-09-02 14:34:16');
